import React from 'react' 

const DogDetail = (props) => {
    return (
        <React.Fragment>
            <img src={props.dog.image} />
            <h2>{props.dog.name}</h2>
            <button>{props.dog.isGoodDog ? "Good Dog!" : "Bad Dog!"}</button>
        </React.Fragment>
    )
}

export default DogDetail
